import type { Config } from '@jest/types';

const config: Config.InitialOptions = {
    projects: [
        {
            displayName: 'UNIT',
            testEnvironment: 'node',
            testMatch: ['<rootDir>/src/**/*.spec.ts', '<rootDir>/test/index.spec.ts', '<rootDir>/bin/index.spec.js'],
            moduleFileExtensions: ['js', 'ts', 'd.ts'],
            moduleNameMapper: {
                '\\.hbs$': '<rootDir>/src/templates/__mocks__/index.ts',
            },
        },
        {
            displayName: 'E2E',
            testEnvironment: 'node',
            testMatch: [
                '<rootDir>/test/e2e/v2.fetch.spec.ts',
                '<rootDir>/test/e2e/v2.xhr.spec.ts',
                '<rootDir>/test/e2e/v2.node.spec.ts',
                '<rootDir>/test/e2e/v2.axios.spec.ts',
                '<rootDir>/test/e2e/v2.babel.spec.ts',
                '<rootDir>/test/e2e/v2.angular.spec.ts',
                '<rootDir>/test/e2e/v3.fetch.spec.ts',
                '<rootDir>/test/e2e/v3.xhr.spec.ts',
                '<rootDir>/test/e2e/v3.node.spec.ts',
                '<rootDir>/test/e2e/v3.axios.spec.ts',
                '<rootDir>/test/e2e/v3.babel.spec.ts',
                '<rootDir>/test/e2e/v3.angular.spec.ts',
                '<rootDir>/test/e2e/client.fetch.spec.ts',
                '<rootDir>/test/e2e/client.xhr.spec.ts',
                '<rootDir>/test/e2e/client.node.spec.ts',
                '<rootDir>/test/e2e/client.axios.spec.ts',
                '<rootDir>/test/e2e/client.babel.spec.ts',
                '<rootDir>/test/e2e/client.angular.spec.ts',
            ],
            modulePathIgnorePatterns: ['<rootDir>/test/e2e/generated'],
        },
    ],
    collectCoverageFrom: ['<rootDir>/src/**/*.ts', '!<rootDir>/src/**/*.d.ts', '!<rootDir>/bin', '!<rootDir>/dist'],
};

export default config;

import commonjs from '@rollup/plugin-commonjs';
import { nodeResolve } from '@rollup/plugin-node-resolve';
import terser from '@rollup/plugin-terser';
import typescript from '@rollup/plugin-typescript';
import { readFileSync } from 'fs';
import handlebars from 'handlebars';
import { dirname, extname, resolve } from 'path';

const { precompile } = handlebars;

/**
 * Custom plugin to parse handlebar imports and precompile
 * the template on the fly. This reduces runtime by about
 * half on large projects.
 */
const handlebarsPlugin = () => ({
    resolveId: (file, importer) => {
        if (extname(file) === '.hbs') {
            return resolve(dirname(importer), file);
        }
        return null;
    },
    load: file => {
        if (extname(file) === '.hbs') {
            const template = readFileSync(file, 'utf8').toString().trim();
            const templateSpec = precompile(template, {
                strict: true,
                noEscape: true,
                preventIndent: true,
                knownHelpersOnly: true,
                knownHelpers: {
                    ifdef: true,
                    equals: true,
                    notEquals: true,
                    containsSpaces: true,
                    union: true,
                    intersection: true,
                    enumerator: true,
                    escapeComment: true,
                    escapeDescription: true,
                    camelCase: true,
                },
            });
            return `export default ${templateSpec};`;
        }
        return null;
    },
});

const getPlugins = () => {
    const plugins = [
        nodeResolve(),
        commonjs({
            sourceMap: false,
        }),
        handlebarsPlugin(),
        typescript({
            module: 'esnext',
        }),
    ];
    if (process.env.NODE_ENV === 'development') {
        return plugins;
    }
    return [...plugins, terser()];
};

export default {
    input: './src/index.ts',
    output: {
        exports: 'named',
        file: './dist/index.js',
        format: 'cjs',
    },
    external: ['camelcase', 'commander', 'fs-extra', 'handlebars', '@apidevtools/json-schema-ref-parser'],
    plugins: getPlugins(),
};
